import React from 'react';
import { Switch, Route } from 'react-router-dom';

import CollectionOverview from '../../components/Collections/Overview';

const ShopPage = () => (
	<Switch>
		<Route exact path="/" component={CollectionOverview} />
	</Switch>
);

export default ShopPage;
